【フジコ 眉ティント 01 ショコラブラウンの詳細】<br>
●消えないナチュ眉なら「寝起きかわいい」まるで地眉毛。<br>
●自然に色づく眉ティント。<br><br>

【使用方法】<br>
※本製品を塗る前に、眉表面の油分をティッシュなどでおさえて整えて下さい。<br>
1.好みの形に塗ります。5-10分で乾燥し沈着しますが、2時間以上置くと長持ちします。（約3日程度）<br>
2.乾いたらはがします。はがす際に眉毛の抜けがきになる方は、ジェルの乾燥後、ぬるま湯で洗い流して下さい。<br><br>

【ご注意】<br>
○眉及び眉周辺に肌に異常がある時はご使用をおやめください。<br>
○化粧品が肌に合わない時、または使用中に赤み、はれ、かゆみ、刺激などの異常があらわれた場合、使用時に直射日光などが当たって眉及び眉周辺の肌に異常があらわれた場合は使用を中止してください。そのまま使用を続けますと症状を悪化させることがありますので、専門医へのご相談をおすすめします。<br>
○剥がす際は強く引っ張らず、ゆっくり剥がしてください。<br>
○着色後色を薄めたい場合リムーバーをつけた化粧綿などで丁寧に皮膚のキメに沿って拭いてください。<br>
○使用後は必ずキャップを閉めて保管してください。<br>
○乳幼児の手が届かない所に保管してください。<br>
○高温や低温の場所、直射日光のあたる場所には置かないでください。<br>
○衣類等につかないよう、気をつけてください。<br><br>

【成分】<br>
水、エタノール、BG、ポリビニルアルコール、ジヒドロキシアセトン、PVP、1.2-ヘキサンジオール、黄5、ポリソルベート80、塩化Na、香料、フェキシエタノール、赤227、クエン酸、青1、EDTA-2Na<br><br>

【内容量】<br>
1本<br><br>

【販売元】<br>
株式会社かならぼ<br>
東京都世田谷区奥沢5-8-7<br>
お電話：03-6869-3060<br><br>

【商品区分】<br>
化粧品<br><br>

[Fujiko マユティント] 

