◆パウダー仕上げが簡単に<br><br>

・ペンシル形状なので、テクニックがなくても簡単に描ける。<br><br>

・ペンシル状に練り固めているパウダーなので、眉尻などの細かいところまできちんと描ける。<br><br>

・ブラシでぼかせばパウダー状に戻るので、ふわりと自然な仕上がりに。<br><br>

・2mm芯のくり出しタイプ。<br><br><br>

◆自然な仕上がり一日続く<br><br>

・密着成分配合なので、眉毛はもちろん眉尻など毛のまばらな部分にもパウダーがピタッと密着。<br><br>

